import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom"
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route index element={<h1>Hello World 1</h1>}/>
          <Route path='movie/:id' element={<h1>Movie Detail Page</h1>}/>
          <Route path='movie/:type' element={<h1>Movie List page</h1>}/>
          <Route path='movie/:type' element={<h1>Movie List page</h1>}/>

        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
